import React from 'react';
import './App.css';
import Navbar from './Navbar';
import Plateau from './Plateau.js'
import Controle from './Controle.js'



function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <main>
        <Plateau></Plateau>
        <Controle></Controle>
      </main>
    </div>
  );
}

export default App;
